import { useState } from "react";
import { Box, TextField, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from "@mui/material";
import axios from "axios";

const endpointMapping = {
  Notion: "notion",
  Airtable: "airtable",
};

export const DataForm = ({ integrationType, credentials }) => {
  const [loadedData, setLoadedData] = useState(null);
  const endpoint = endpointMapping[integrationType];

  const handleLoad = async () => {
    try {
      const formData = new FormData();
      formData.append("credentials", JSON.stringify(credentials));
      const response = await axios.post(
        `http://localhost:8000/integrations/${endpoint}/load`,
        formData
      );
      const data = response.data;
      setLoadedData(data);
    } catch (e) {
      alert(e?.response?.data?.detail);
    }
  };

  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      flexDirection="column"
      width="100%"
    >
      <Box display="flex" flexDirection="column" width="100%">
        <TextField
          label="Json Loaded Data"
          value={loadedData ? JSON.stringify(loadedData, null, 2) : ""}
          sx={{ mt: 2 }}
          InputLabelProps={{ shrink: true }}
          disabled
        />
        <Button onClick={handleLoad} sx={{ mt: 2 }} variant="contained">
          Load Data
        </Button>
        <Button
          onClick={() => setLoadedData(null)}
          sx={{ mt: 1 }}
          variant="contained"
        >
          Clear Data
        </Button>
      </Box>

      {loadedData && (
        <Box sx={{ mt: 4, width: '100%', maxWidth: '1200px' }}>
          <TableContainer component={Paper} sx={{ maxHeight: 300 }}>
            <Table stickyHeader aria-label="integration items table">
              <TableHead>
                <TableRow>
                  <TableCell>Name</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Parent ID</TableCell>
                  <TableCell>Parent Name</TableCell>
                  <TableCell>Children</TableCell>
                  <TableCell>Creation Time</TableCell>
                  <TableCell>Last Modified Time</TableCell>
                  <TableCell>Directory</TableCell>
                  <TableCell>Drive ID</TableCell>
                  <TableCell>Mime Type</TableCell>
                  <TableCell>Delta</TableCell>
                  <TableCell>URL</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {loadedData.map((item, index) => (
                  <TableRow key={index}>
                    <TableCell>{item.name || "N/A"}</TableCell>
                    <TableCell>{item.type || "N/A"}</TableCell>
                    <TableCell>{item.parent_id || "N/A"}</TableCell>
                    <TableCell>{item.parent_path_or_name || "N/A"}</TableCell>
                    <TableCell>{item.children || "None"}</TableCell>
                    <TableCell>{item.creation_time || "N/A"}</TableCell>
                    <TableCell>{item.last_modified_time || "N/A"}</TableCell>
                    <TableCell>{item.directory ? "Yes" : "No"}</TableCell>
                    <TableCell>{item.drive_id || "N/A"}</TableCell>
                    <TableCell>{item.mime_type || "N/A"}</TableCell>
                    <TableCell>{item.delta || "N/A"}</TableCell>
                    <TableCell>{item.url || "N/A"}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Box>
      )}
    </Box>
  );
};
